import React from 'react';
import ReactDOM from 'react-dom';

const a = 1234, b = 4321;

/* const obj = {
    a: 1,
    b: 2
}; */
const obj = <span>这是一个span元素</span>;

const arr = [2, 3, 4, 5, 6];
const arr2 = [2, null, undefined, false, 3];

const numbers = new Array(30);
numbers.fill(0);
var lis = numbers.map((item,i)=>{
    return <li>i</li>;
});

const h1 = (
    <React.Fragment>
        <h1>Hello World <span>spa元素</span></h1>
        <p>lorem</p>
        <img src="https://dss1.bdstatic.com/70cFvXSh_Q1YnxGkpoWK1HF6hhy/it/u=1009600391,1287960116&fm=26&gp=0.jpg" alt=""></img>
        <p>{a} * {b} = {a * b}</p>
        <p>{null}{undefined}{false}</p>
        {/*以下不会产生任何输出*/}
        <p>{ /* obj */}</p>
        <p>{obj}</p>
        {/* 遍历数组把每一项数组的值放进来 */}
        <p>{arr}</p>
        <p>{arr2}</p>{/* 2 3 null undefined false 不会显示 */}

    </React.Fragment>
);/* (JS表达式) */
console.log(h1);//type: Symbol(react.fragment) type: "h1"(字符串)
ReactDOM.render(h1, document.getElementById('root'));
